import React from 'react';

const TableItems = ({titles, fRUB, rEUR, rUSD, sumRUB}) => {
  const rateRub = fRUB;
  const rateEur = rEUR;
  const rateUsd = rUSD;

  return (
    <table border='1' bgcolor='#f5deb3' className='table-items'>

      {titles.map((title) =>
        <th className='table-th' title={title} key={title.id}>
          {title.title}
        </th>
        )}

      <tr className='table-tr'>
        <td className='table-td'>RUB/CUPCAKE</td>

        {sumRUB.map((rub) =>
          <td className='table-td' rub={rub} key={rub.id}>
            {rub}
          </td>
        )}

        {/*<td className='table-td'>{rateRub}</td>*/}
        {/*<td className='table-td'>{rateRub}</td>*/}
        {/*<td className='table-td'>{rateRub}</td>*/}
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>USD/CUPCAKE</td>
        <td className='table-td'>{rateUsd}</td>
        <td className='table-td'>{rateUsd}</td>
        <td className='table-td'>{rateUsd}</td>
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>EUR/CUPCAKE</td>
        <td className='table-td'>{rateEur}</td>
        <td className='table-td'>{rateEur}</td>
        <td className='table-td'>{rateEur}</td>
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>RUB/USD</td>
        <td className='table-td'>{rateRub/rateUsd}</td>
        <td className='table-td'>{rateRub/rateUsd}</td>
        <td className='table-td'>{rateRub/rateUsd}</td>
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>RUB/EUR</td>
        <td className='table-td'>{rateRub/rateEur}</td>
        <td className='table-td'>{rateRub/rateEur}</td>
        <td className='table-td'>{rateRub/rateEur}</td>
      </tr>
      <tr className='table-tr'>
        <td className='table-td'>EUR/USD</td>
        <td className='table-td'>{rateEur/rateUsd}</td>
        <td className='table-td'>{rateEur/rateUsd}</td>
        <td className='table-td'>{rateEur/rateUsd}</td>
      </tr>
    </table>
  );
};

export default TableItems;
